import Head from 'next/head';
import Link from 'next/link';
import Layout from '../components/layout';
import HeadMetadata from '../components/head-metadata';
import ScreenShot from '../components/screen-shots/screen-shot';

let screenShotData = [
    {
        src: "/game-screenshot_KTV-room-2.png",
        alt: "game screenshot of a KTV room",
        caption: "who knew moving bottles could affect so much?!"
    },
    {
        src: "/game-screenshot_eileen-1.png",
        alt: "game screenshot of speaking to Eileen",
        caption: "who knew moving bottles could affect so much?!"
    }
];

const ScreenShots = () => (
    <Layout>
        <Head>
            {
                // need this syntax for Components to work in Head
                HeadMetadata()
            }
            <title>screenshots</title>
        </Head>
        <h1>screenshots</h1>
        <section>
            <p>screenshots below:</p>
            {<ScreenShot />}
            {screenShotData.forEach((screenShot, i) => {
                console.log(`screenShot: ${screenShot.src}`);
                return (
                    <ScreenShot
                        id =        {i}
                        src =       {screenShot.src}
                        alt =       {screenShot.alt}
                        caption =   {screenShot.caption}

                    />
                );
            })}
        </section>
        <h2>
            <Link href="/">
                <a>Back to home</a>
            </Link>
        </h2>
    </Layout>
);

export default ScreenShots;
